import React from "react";

function MainWindow(){
    return(
        <div className="MainWindow">  
        <div className="COL1">
            <div className="A1">A1</div>
            <div className="A2">A2</div>
        </div>
        <div className="COL1">
            <div className="B1">B1</div>
            <div className="B2">B2</div>
        </div>
        </div>
    )
}



export default MainWindow;
